const About = () => {
    return (
      <div className="App">
        <p>Me olemme joukko kalastuksesta ja ympäristöasioista kiinnostuneita vaikuttajia ja haluamme lisätä tietoisuutta kalakantojen vähenemisestä ja edistää kestävää kalastusta. Tavoitteenamme on varmistaa, että tulevat sukupolvet voivat nauttia terveistä ja monimuotoisista luonnosta.

Voit ottaa meihin yhteyttä:

Sähköposti: [sähköpostiosoite]
Puhelinnumero: [puhelinnumero]

Olemme avoimia yhteistyölle ja ideoille. Jos sinulla on ehdotuksia, haluat osallistua kampanjoihimme tai tarvitset lisätietoja kalakantojen vähenemisestä, älä epäröi ottaa meihin yhteyttä. Yhdessä voimme tehdä muutoksen ja turvata tulevaisuuden kalakannat!

Kiitos, että olet mukana taistelussa kestävän kalastuksen puolesta!</p>
      </div>
    );
  };
    
  export default About;
